import React, { Component } from 'react';


//props: 
// name
// region
// season

class Display extends Component {
    state = {  } 
    render() { 
        return (
            /** of class flex-container-display */
            <React.Fragment>

                <h1 class="flex-item-display flex-item-display-name">{this.props.name}</h1>

                    <div class="flex-item-display flex-item-display-region">
                        {this.props.region }
                    </div>
                    <div class="flex-item-display flex-item-display-season">
                        { this.props.season }
                    </div>
            </React.Fragment>

        );
    }
}

export default Display;
